import React from "react";
import "./RegisterUsername.css";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import "bootstrap/dist/css/bootstrap.min.css";
import {Redirect} from "react-router-dom"

const RegisterUsername = () => {

  const handleLoginButton = () => {
    R
  }

  return (
    <div className = "register-username-box">
      <Form>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label class="login-page-label">Email address</Form.Label>
          <Form.Control type="email" placeholder="Enter email" />
          <Form.Text className="text-muted"></Form.Text>
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label class="login-page-label">Password</Form.Label>
          <Form.Control type="password" placeholder="Password" />
        </Form.Group>
        
        <Form.Group className="mb-3" controlId="formBasicConfirmPassword">
          <Form.Label class="login-page-label">Confirm Password</Form.Label>
          <Form.Control type="password" placeholder="Password" />
        </Form.Group>

        <Button variant="primary" type="submit" onClick={handleLoginButton}>
          Back to Login
        </Button>

        <Button variant="primary" type="submit">
          Next
        </Button>
      </Form>
    </div>
  );
};

export default RegisterUsername;
